import React from "react";
import InternalLogo from "../shared/components/InternalLogo";
import RenderStepsSwitch from "./RenderStepsSwitch";

type UserAccessStepsProps = {
    onCloseClick?(): void;
    isModal?: boolean;
};
const UserAccessSteps: React.FC<UserAccessStepsProps> = ({ onCloseClick, isModal }: UserAccessStepsProps) => {
    return (
        <>
            <InternalLogo />
            <RenderStepsSwitch isModal={isModal} onCloseClick={onCloseClick} />
        </>
    );
};

export default UserAccessSteps;
